import './App.css';
import { useState } from 'react'
import ColourButton from './components/ColourButton';

function App() {
  const [background, setBackground] = useState("blue")

  return (
    <div className="App">
      <header className="App-header">
        <ColourButton col={"green"} style={{ backgroundColor: background }} action={setBackground}/>
      </header>
    </div>
  );
}

export default App;
